        body: "## What Ruby, Rails and RSpec versions are you using?\r\n\r\nRuby version: `2.6.5p114 (2019-10-01 revision 67812) [x86_64-darwin18]`\r\nRails version: `6.0.2.rc1`\r\nRSpec version: \r\n```\r\nRSpec 3.9\r\n  - rspec-core 3.9.0\r\n  - rspec-expectations 3.9.0\r\n  - rspec-mocks 3.9.0\r\n  - rspec-rails 3.9.0\r\n  - rspec-support 3.9.0\r\n```\r\n\r\n## Observed behaviour\r\nRequest spec:\r\n```\r\n     params = {\r\n        wordlist_entry: {\r\n          word: 'dog',\r\n          description: 'A hairy animal of varying size.'\r\n        }\r\n      }\r\n\r\n      headers = {\r\n        'Authorization' => \"Bearer #{token}\",\r\n        'CONTENT_TYPE' => 'application/vnd.api+json'\r\n      }\r\n\r\n      time_now = Time.now\r\n      post '/wordlistentries', params: params # add `, headers: headers` here and neither the params nor the headers get through to the controller - I need both\r\n```\r\n\r\n## Expected behaviour\r\nThe headers and the params should appear in the controller as headers and request body respectively.\r\n\r\n## Can you provide an example app?\r\nhttps://github.com/Yorkshireman/my_wordlist_resources/blob/bbdbdc7302e864d2eba53e6343dccd3ec88e3b80/spec/requests/create_wordlist_entry_spec.rb#L31\r\n\r\n"
